import React from "react";
import { useAuth } from "../provider/authProvider";
import { Navigate } from "react-router-dom";

const Login = () => {
  const { setToken } = useAuth();

  const handleLogin = () => {
    setToken("this is a test token");
    return <Navigate exact to="/" />;
  };

  handleLogin();

  return <>Login Page</>;
};

export default Login;
